from journey import *class Cjm:    def __init__(self, activity_set):        self.overall_quality = None        self.activity_set = activity_set        self.journey = []        self.quality = {}    #Add a journey (with a random activity)    def add_journey_with_random_activity(self):        journey = Journey(self.activity_set)        journey.add_random_activity()        self.journey.append(journey)    def add_journey(self, activities):        journey = Journey(self.activity_set)        journey.add_complete_journey(activities)        self.journey.append(journey)    #Delete a journey (only if at least 2 journey on the map)    def delete_journey(self):        if len(self.journey)>1:            self.journey.pop(random.randrange(len(self.journey)))    def delete_journey_x(self,x):        self.journey.remove(x)    def __str__(self):        output = "weighted: "+str(self.overall_quality)+" ["        for key, quality in self.quality.iteritems():            output += key + ':' + str(quality.get_quality())+' '        output += ']'        for journey in self.journey:            output += str(journey)        return output